import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../../App.css";

const DataStoragePage = () => {
  const navigate = useNavigate();
  const [uploadedFiles, setUploadedFiles] = useState([]);
  const [editingHistory, setEditingHistory] = useState([]);

  useEffect(() => {
    // Fetch uploaded filenames from localStorage
    const files = JSON.parse(localStorage.getItem("uploadedFilenames") || "[]");
    setUploadedFiles(files);

    const originalJson = JSON.parse(localStorage.getItem("originalJson") || "{}");
    const editedJson = JSON.parse(localStorage.getItem("editedJson") || "{}");

    const edits = [];

    Object.keys(editedJson).forEach((line, index) => {
      const original = line;
      const edited = editedJson[line];

      if (original !== edited) {
        let start = 0;
        while (
          start < original.length &&
          original[start] === edited[start]
        ) {
          start++;
        }

        let endOrig = original.length - 1;
        let endEdit = edited.length - 1;
        while (
          endOrig > start &&
          endEdit > start &&
          original[endOrig] === edited[endEdit]
        ) {
          endOrig--;
          endEdit--;
        }

        const from = original.slice(start, endOrig + 1);
        const to = edited.slice(start, endEdit + 1);

        edits.push(`Line ${index + 1}: “${from}” → “${to}”`);
      }
    });

    setEditingHistory(edits.slice(0, 4)); // Show first few edits
  }, []);

  return (
    <div
      style={{
        backgroundColor: "#F0DFC3",
        fontFamily: "Proxima Nova",
        minHeight: "100vh",
        padding: "50px 100px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      {/* Section: Editing History */}
      <div style={{ marginBottom: "50px" }}>
        <h1
          style={{
            fontSize: "50px",
            fontWeight: "bold",
            color: "#A6785E",
            textAlign: "center",
            marginBottom: "25px",
          }}
        >
          Editing History
        </h1>
        <div
          style={{
            color: "#50464E",
            fontSize: "30px",
            padding: "0 40px",
            marginBottom: "25px",
          }}
        >
          {editingHistory.length > 0 ? (
            <>
              {editingHistory.map((edit, index) => (
                <p key={index} style={{ marginLeft: "20px" }}>{edit}</p>
              ))}
              <p
                style={{
                  color: "#A6785E",
                  cursor: "pointer",
                  fontStyle: "italic",
                  marginLeft: "40px",
                  marginTop: "25px",
                }}
                onClick={() => navigate("/all-documents")}
              >
                Show all edits
              </p>
            </>
          ) : (
            <p style={{ marginLeft: "20px" }}>No edits yet.</p>
          )}
        </div>
      </div>

      {/* Section: Uploaded Files */}
      <div style={{ marginBottom: "50px" }}>
        <h1
          style={{
            fontSize: "50px",
            fontWeight: "bold",
            color: "#A6785E",
            textAlign: "center",
            marginBottom: "25px",
          }}
        >
          Uploaded Files
        </h1>
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(4, 1fr)",
            justifyItems: "center",
            fontSize: "30px",
            color: "#50464E",
            marginBottom: "25px",
            columnGap: "120px",
            rowGap: "15px",
          }}
        >
          {uploadedFiles.length > 0 ? (
            uploadedFiles.map((name, index) => (
              <p key={index}>{name}</p>
            ))
          ) : (
            <p style={{ gridColumn: "span 4" }}>No uploaded files</p>
          )}
        </div>

        <p
          style={{
            textAlign: "center",
            fontSize: "30px",
            color: "#A6785E",
            cursor: "pointer",
            fontStyle: "italic",
            marginBottom: "25px",
          }}
          onClick={() => navigate("/all-documents")}
        >
          Show all files
        </p>
      </div>

      {/* Back Button */}
      <div style={{ display: "flex", justifyContent: "flex-end" }}>
        <button
          style={{
            fontSize: "30px",
            backgroundColor: "#DEA93D",
            color: "#50464E",
            padding: "10px 30px",
            borderRadius: "10px",
            border: "none",
            cursor: "pointer",
            fontWeight: "bold",
          }}
          onClick={() => navigate("/")}
        >
          Back
        </button>
      </div>
    </div>
  );
};

export default DataStoragePage;
